import React, { useState, useEffect } from 'react';
import axios from 'axios';

const App = () => {
  const [apiData, setApiData] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:4000/api/ping/check-cctv');
        setApiData(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>API Response</h1>
      {apiData ? (
        <div>
          <p>Success: {apiData.success.toString()}</p>
          <p>Message: {apiData.message}</p>
          <p>Results: {apiData.results}</p>
          <h2>Data:</h2>
          <ul>
            {apiData.data.map((item, index) => (
              <li key={index}>{item.room}</li>
            ))}
          </ul>
        </div>
      ) : (
        <p>Loading...</p>
      )}
    </div>
  );
};

export default App;
